import Avator from "../components/Avator";
import Divider from "../components/Divider";
import Page from "../components/Page";
import { Body1 } from "../components/Texts";
import { makeStyles } from "@material-ui/core/styles";
import SearchBar from "../components/SearchBar";

import PopularTabs from "../components/PopularTabs";


const useStyles = makeStyles({
  container: {
    background: "white",
    display: "flex",
    padding: "0px",
    borderRadius: "20px"
  },
  avatorCard: {
    padding: "16px",
    borderRadius: "20px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    "&:hover": {
      boxShadow: "0px 0px 10px 1px rgba(0, 0, 0, 0.09)",
    }
  }
});

const Index = props => {

  const classes = useStyles(props);
  return (
    <Page>

      <SearchBar placeholder="Search On Google" />

      <Body1>Social</Body1>

      {/* webList-Tab */}


      <PopularTabs />



      <div className={classes.container}>

        <div className={classes.avatorCard}>
          <Avator />
          <Divider vertical space="8px" />
          <Body1>Instagram</Body1>
        </div>


        <Divider space="4px" />


        <div className={classes.avatorCard}>
          <Avator />
          <Divider vertical space="8px" />
          <Body1>Instagram</Body1>
        </div>

      </div>
    </Page>
  )
}

export default Index;
